import React, {Component} from "react";
import TemplateDefault from '../../components/TemplateDefault';
import TemplateComponentBlock from '../../components/TemplateComponentBlock';

export default class Sitewide extends Component {

  constructor(props) {
    super(props);

    this.elements = [
      `<div class="p-5">
        	<div class="collage">
        		<a class="collage_item" href="#" style="background-image: url(https://pics.harstatic.com/agent/614682.jpg?ts=2019-05-13T18:54:00)"></a>
        		<a class="collage_item" href="#" style="background-image: url(https://pics.harstatic.com/agent/724268.jpg?ts=2019-08-27T08:22:00)"></a>
        		<a class="collage_item" href="#" style="background-image: url(https://pics.harstatic.com/agent/657743.jpg?ts=2016-01-20T16:48:00)"></a>
        		<a class="collage_item" href="#" style="background-image: url(https://pics.harstatic.com/agent/571069.jpg?ts=2020-03-09T13:29:00)"></a>
        		<a class="collage_item" href="#" style="background-image: url(https://pics.harstatic.com/agent/592300.jpg?ts=2021-02-11T09:55:00)"></a>
        		<a class="collage_item" href="#" style="background-image: url(https://pics.harstatic.com/agent/637272.jpg?ts=2017-11-14T16:21:00)"></a>
        		<a class="collage_item" href="#" style="background-image: url(https://pics.harstatic.com/agent/646680.jpg?ts=2015-10-16T18:33:00)"></a>
        		<a class="collage_item" href="#" style="background-image: url(https://pics.harstatic.com/agent/744599.jpg?ts=2020-10-09T09:31:00)"></a>
        		<a class="collage_item" href="#" style="background-image: url(https://pics.harstatic.com/agent/699976.jpg?ts=2019-11-06T16:38:00)"></a>
        		<div class="clearfix"></div>
        	</div>
       </div>`,
    ];


    this.codeSnippets = [
`<div class="label label--forsale">for sale</div>
<div class="label label--forrent">for rent</div>
<div class="label label--sold">sold</div>
<div class="label label--newconstruction"><img src="https://content.harstatic.com/media/icons/icon-new-construction.svg">New construction</div>
<div class="label label--justlisted"><img src="https://content.harstatic.com/media/icons/icon-just-listed.svg">Just listed</div>          
<div class="label label--openhouse">Open House</div>`,
`<div class="label label--grade label--grade_a">A</div>
<div class="label label--grade label--grade_d">D</div>`,
`<div class="label label--typeahead  label--typeahead_street">Street</div>
<div class="label label--typeahead  label--typeahead_city">City</div>
<div class="label label--typeahead  label--typeahead_zipcode">Zip Code</div>
<div class="label label--typeahead  label--typeahead_mls">MLS#</div>
<div class="label label--typeahead  label--typeahead_district">District</div>
<div class="label label--typeahead  label--typeahead_school">School</div>`,			
];

  }

  render(){
    return (
      <TemplateDefault
        pageTitle="Sitewide"
        activeParent="components"
        activeChild="sitewide">

        <TemplateComponentBlock blockTitle="Listing Sitewide" elements={this.elements[0]} codeSnippets={this.codeSnippets[0]} />
        <TemplateComponentBlock blockTitle="School Sitewide" elements={this.elements[1]} codeSnippets={this.codeSnippets[1]} />

      </TemplateDefault>
    )
  }

}
